import React from 'react';

const Cafe = () => {
return (
	<div>
	<h1>Our menu</h1>
	<table>
		<th>
			<td>Item</td>
			<td>Price</td>
		</th>
		<tr>
			<td>Apple strudel</td>
			<td>7.50</td>
		</tr>
	</table>
	</div>
);
};

export default Cafe;
